import "../App.css";
import React from "react";

function PostBar(props) {
  const selectPlaceholder = "Mood";
  return (
    <div className="PostBar">
      <select className="PostBarMood" value={selectPlaceholder}>
        <option value="Sun">°C</option>
        <option value="Rain">°F</option>
      </select>
      <input
        className="PostBarContent"
        placeholder="What's on your mind?"
      ></input>
      <button className="PostBarPost">Post</button>
    </div>
  );
}

export default PostBar;
